  quality_rating: 4.2,
  active_pilots: 12,
  system_capacity: 50,
  new_adoptions: 3,
  total_contacts: 20
};

const kpiMetrics = {
  workflow_efficiency: {
    avg_processing_time: mockData.processing_time,
    automation_rate: (mockData.automated_tasks / mockData.total_tasks) * 100,
    error_rate: (mockData.errors / mockData.total_executions) * 100
  },
  report_turnaround: {
    avg_turnaround_hours: mockData.avg_turnaround,
    sla_compliance: (mockData.on_time_reports / mockData.total_reports) * 100
  },
  diagnostic_accuracy: {
    accuracy_score: mockData.accuracy_score,
    quality_rating: mockData.quality_rating
  },
  scalability: {
    concurrent_pilots: mockData.active_pilots,
    system_capacity: mockData.system_capacity,
    adoption_rate: (mockData.new_adoptions / mockData.total_contacts) * 100
  }
};

return [{ json: { timestamp: new Date().toISOString(), kpiMetrics } }];

// Academic Content Generation
const mockPilotData = {
