    }
  }
};

return [{ json: { ...items[0].json, academicContent } }];

// Business Model Advisory Logic
const mockBusinessData = {
  subscription_viability: true,
  usage_based_viability: true,
  licensing_viability: false,
  impl_cost: 150000,
  ops_cost: 25000,
  training_cost: 35000,
  payback_months: 8,
  npv: 450000,
  irr: 0.35
};

const businessGuidance = {
  revenue_models: {
    subscription: mockBusinessData.subscription_viability,
    per_use: mockBusinessData.usage_based_viability,
    licensing: mockBusinessData.licensing_viability,
    recommended: 'Hybrid subscription + per-use model'
  },
  cost_analysis: {
    implementation_cost: mockBusinessData.impl_cost,
    operational_cost: mockBusinessData.ops_cost,
    training_cost: mockBusinessData.training_cost,
    total_first_year: mockBusinessData.impl_cost + mockBusinessData.ops_cost + mockBusinessData.training_cost
  },
  roi_projection: {
    payback_period: mockBusinessData.payback_months,
    net_present_value: mockBusinessData.npv,
    internal_rate_return: mockBusinessData.irr * 100,
    break_even_point: 'Month 8'
  },
  risk_assessment: {
    technical_risk: 'Low',
    market_risk: 'Medium',
    regulatory_risk: 'Low',
    overall_risk: 'Medium-Low'
  }
};

return [{ json: { ...items[0].json, businessGuidance } }];

// Quality Assessment Logic
const mockQualityData = {
  report_completeness: 92,
  diagnostic_accuracy: 95,
  delivery_timeliness: 88,
  report_clarity: 90,
  clinical_relevance: 93
};

const qualityMetrics = {
  completeness: mockQualityData.report_completeness,
  accuracy: mockQualityData.diagnostic_accuracy,
  timeliness: mockQualityData.delivery_timeliness,
  clarity: mockQualityData.report_clarity,
  clinical_relevance: mockQualityData.clinical_relevance
};

// Calculate overall quality score
const overallScore = Object.values(qualityMetrics).reduce((sum, score) => sum + score, 0) / Object.keys(qualityMetrics).length;

const qualityGrade = overallScore >= 90 ? 'Excellent' : 
                   overallScore >= 80 ? 'Good' : 
                   overallScore >= 70 ? 'Satisfactory' : 'Needs Improvement';

const improvementAreas = [];
if (qualityMetrics.completeness < 90) improvementAreas.push('Report Completeness');
if (qualityMetrics.accuracy < 95) improvementAreas.push('Diagnostic Accuracy');
if (qualityMetrics.timeliness < 90) improvementAreas.push('Delivery Timeliness');
if (qualityMetrics.clarity < 90) improvementAreas.push('Report Clarity');
if (qualityMetrics.clinical_relevance < 90) improvementAreas.push('Clinical Relevance');

return [{ json: { ...items[0].json, qualityMetrics, overallScore: Math.round(overallScore * 100) / 100, qualityGrade, improvementAreas } }];

// Scalability Analysis
const mockScalabilityData = {
  active_pilots: 12,
  max_pilots: 50,
  monthly_growth: 0.15,
  team_capacity: 'adequate',
  tech_scalability: 'high'
};

const utilizationRate = (mockScalabilityData.active_pilots / mockScalabilityData.max_pilots) * 100;

const scalabilityMetrics = {
  current_capacity: {
    active_pilots: mockScalabilityData.active_pilots,
    max_concurrent_pilots: mockScalabilityData.max_pilots,
    utilization_rate: Math.round(utilizationRate * 100) / 100
  },
  growth_projections: {
    monthly_growth_rate: mockScalabilityData.monthly_growth * 100,
    projected_6_month: Math.round(mockScalabilityData.active_pilots * Math.pow(1 + mockScalabilityData.monthly_growth, 6)),
    capacity_threshold: mockScalabilityData.max_pilots * 0.8
  },
  readiness_assessment: {
    infrastructure_ready: utilizationRate < 80,
    team_capacity: mockScalabilityData.team_capacity,
    technology_scalability: mockScalabilityData.tech_scalability,
    scaling_recommendation: utilizationRate > 70 ? 'Consider capacity expansion' : 'Current capacity adequate'
  }
};

return [{ json: { ...items[0].json, scalabilityMetrics } }];

// Comprehensive Report Generator
const reportData = {
  executionId: Date.now().toString(),
  timestamp: new Date().toISOString(),
  summary: {
    kpi_status: 'All metrics within acceptable ranges',
    academic_readiness: 'Ready for publication',
    business_viability: 'High ROI potential',
    quality_grade: items[0].json.qualityGrade,
    scalability_status: items[0].json.scalabilityMetrics.readiness_assessment.scaling_recommendation
  },
  detailed_metrics: {
    kpi: items[0].json.kpiMetrics,
    academic: items[0].json.academicContent,
    business: items[0].json.businessGuidance,
    quality: {
      overall_score: items[0].json.overallScore,
      grade: items[0].json.qualityGrade,
      improvement_areas: items[0].json.improvementAreas
    },
    scalability: items[0].json.scalabilityMetrics
  },
  recommendations: [
    'Continue current pilot expansion strategy',
    'Prepare academic publications for Q2',
    'Consider scaling infrastructure at 75% capacity',
    'Focus on improving areas identified in quality assessment'
  ]
};

console.log('PAP Enhanced Workflow Completed:', reportData.summary);

return [{ json: reportData }];
